#include <iostream>
#include <vector>
#include <queue>

using namespace std;

class Solution {
public:
    int secondMinimum(int n, vector<vector<int>>& edges, int time, int change) {
        vector<vector<int>> e(n);
        for (auto& i : edges) {
            int from = i[0]-1;
            int to = i[1]-1;
            e[from].push_back(to);
            e[to].push_back(from);
        }
        priority_queue<pair<int,int>, vector<pair<int,int>>, greater<pair<int,int>>> pq;
        pq.push({0,0});
        vector<vector<int>> arrived_time(n);
        while(!pq.empty()){
            auto it = pq.top();
            pq.pop();
            int time_used = it.first;
            int start = it.second;

            if (start == n-1){
                if (arrived_time[start].size() == 0) arrived_time[start].push_back(time_used);
                else if (time_used > arrived_time[start][0]) return time_used;
            }
            if ((time_used / change) % 2) time_used = (time_used / change / 2 + 1) * (change * 2);
            int start_walking_time = time_used + time;
            for (int neighbor : e[start]){
                if (arrived_time[neighbor].size() == 0 || (start_walking_time > arrived_time[neighbor].back() && arrived_time[neighbor].size() < 2)){
                    pq.push({start_walking_time, neighbor});
                    arrived_time[neighbor].push_back(start_walking_time);
                }
            }
        }
        return -1;
    }
};

